  true,\n\t\"url\": null,\n\t\"notes\": \"The following information is given for each
  entry in this database:   the reference for the data; the reaction studied; the
  name of the enzyme used and its Enzyme Commission number; the method of measurement;
  the conditions of measurement (temperature, pH, ionic strength, and the buffer(s)
  and cofactor(s) used); the data and an evaluation of it; and, sometimes, commentary
  on the data and on any corrections which have been applied to it. The absence of
  a piece of information indicates that it was not found in the paper cited.\",\n\t\"license_title\":
